import React from "react";

const CheckBox = ({id, width = '20px', height = '20px', type='chekbox', labelText}) =>{

    const checkBox_style = {
        marginTop: '30px',
        alignItem: 'center',
        width: width,
        height: height,
        color: 'orange'

    }

    return(
        <div>
            <input type={type} id={id} style={checkBox_style}/>
            <label for={id} style={checkBox_style}>{labelText}</label>
        </div>
    )
}

export default CheckBox;
